import React, { useState, useEffect } from 'react';


function App() {
  const [codigo, setCodigo] = useState('');
  const [codigoAnfitrion, setCodigoAnfitrion] = useState('');
  const [data, setData] = useState([]);
  const [name, setName] = useState('');
  const [nameSubmitted, setNameSubmitted] = useState(false);
  const [roleSelected, setRoleSelected] = useState('');
  const [codigoInvalido, setCodigoInvalido] = useState(false);
  const [verificarAnfitrion, setverificarAnfitrion] = useState(false);

  const handleNameSubmit = async () => {
    if (roleSelected === 'Alumno') {
      const response = await fetch('/codigo_respuesta', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ codigo }),
      });

      if (response.ok) {
        const data = await response.json();
        if (data.success) {
          setNameSubmitted(true);
          setCodigoInvalido(false);
          fetchData();
        } else {
          setCodigoInvalido(true);
          console.log('Error, codigo incorrecto');
        }
      } else {
        console.log('Error en la solicitud');
      }
    }
    else if (roleSelected === 'Anfitrion') {
      const response = await fetch('/codigo', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ codigoAnfitrion }),
      });

      if (response.ok) {
        const data = await response.json();
        if (data.success) {
          setverificarAnfitrion(true)
          console.log("Codigo añadido correctamente")
        } else {
          console.log('Error');
        }
      } else {
        console.log('Error en la solicitud');
      }
    }
  };

  const codigoAnfitrionFunc = async () => {
    if (roleSelected === 'Alumno') {
      const response = await fetch('/codigo_respuesta', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ codigo }),
      });

      if (response.ok) {
        const data = await response.json();
        if (data.success) {
          setNameSubmitted(true);
          setCodigoInvalido(false);
          fetchData();
        } else {
          setCodigoInvalido(true);
          console.log('Error, codigo incorrecto');
        }
      } else {
        console.log('Error en la solicitud');
      }
    }

  };


  const handleRoleSelection = async (role) => {
    setRoleSelected(role);
  };

  const fetchData = async () => {
    console.log('AA')
    const response = await fetch('/preguntas', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ codigo }),
    });
    console.log('BB')
    const data = await response.json();
    console.log('CC')
    console.log(data)
    console.log(roleSelected)
    console.log('DD')
    setData(data);
  };

  useEffect(() => {
    if (roleSelected === 'Alumno') {
      fetchData();
    }
  }, [roleSelected]);

  return (
    <div>
      {!roleSelected ? (
        <div>
          <button onClick={() => handleRoleSelection('Alumno')}>Alumno</button>
          <button onClick={() => handleRoleSelection('Anfitrión')}>Anfitrión</button>
        </div>
      ) : roleSelected === 'Alumno' ? (
        !nameSubmitted ? (
          <div>
            <input
              type="text"
              value={codigo}
              onChange={(e) => setCodigo(e.target.value)}
              placeholder="Introduce el codigo dado por el anfitrion"
            />
            <button onClick={handleNameSubmit}>Enviar</button>
            {codigoInvalido && (
              <p>Codigo incorrecto, recarga la pagina e intente nuevamente</p>
            )}
          </div>
        ) : (
          <div>
            {data && data.length > 0 ? (
              data.map((member, i) => (
                <p key={i}>{member}</p>
              ))
            ) : (
              <p>No hay preguntas disponibles.</p>
            )}
          </div>
        )
      ) : roleSelected === 'Anfitrión' ? (
        <div>
            <input
              type="text"
              value={codigoAnfitrion}
              onChange={(e) => setCodigoAnfitrion(e.target.value)}
              placeholder="Codigo"
            />
            <button onClick={codigoAnfitrionFunc}>Enviar</button>
            {verificarAnfitrion ? (
              <p>Codigo subido correctamente</p>
            ):(
              <p>No hay preguntas disponibles.</p>
            )}
          </div>
      ) : null}
    </div>
  );  
}


export default App;


